import React from "react";
import styled from "styled-components";

const ContactUs = () => {
    return (
        <BoxSection>
            <WrapContainer>
                <Header>Contact Us.</Header>
                <WrapperSubmit>
                    <WrapperInput>
                        <input type="text" placeholder="Your Name" />
                    </WrapperInput>
                    <WrapperInput>
                        <input type="text" placeholder="Your Email" />
                    </WrapperInput>
                    <WrapperInput>
                        <input type="text" placeholder="Who Are You" />
                    </WrapperInput>
                    <WrapperMessage>
                        <input
                            type="text"
                            placeholder="Write your message here"
                        />
                    </WrapperMessage>
                </WrapperSubmit>
            </WrapContainer>
        </BoxSection>
    );
};

const BoxSection = styled.section`
    position: relative;
    padding: 8vh 0 0;
    margin: 0 0 2rem;
    @media (max-width: 770px) {
        padding-top: 60px;
        margin: 0 0 1rem;
    }
`;
const WrapContainer = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    flex-direction: column;
    gap: 20px;
    @media (max-width: 576px) {
    }
`;
const Header = styled.div`
    font-size: 56px;
    font-weight: 800;
`;
const WrapperSubmit = styled.div`
    padding: 1rem;
    width: 100%;
    /* display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center; */
    input {
        width: 100%;
        background-color: transparent;
        border: none;
        color: #fff;
        ::placeholder {
            color: #ffffff50;
        }
        :focus-visible {
            outline: none;
        }
    }
`;
const WrapperInput = styled.div`
    max-width: 650px;
    padding: 1rem;
    margin: 10px auto;
    border: 1px solid;
`;
const WrapperMessage = styled.div`
    max-width: 650px;
    padding: 1rem;
    margin: 10px auto;
    border: 1px solid;

    input {
        height: 100px;
    }
`;

export default ContactUs;
